import {Link} from 'react-router-dom' 

export const Nav = () => {
  return (
    <div className="container">
        <div className="row">
            <nav>
                <Link to="/" className='logo'>
                    <img src="assets/images/logo.jpg"  alt="logo" />
                </Link>
            </nav>
        </div>
    </div>
  );
};
